由于是严格多数（大于一半），所以可以使用一一抵消，维护当前次数最多元素，每出现一个不同元素，则消耗一个当前次数最多元素，最后剩下的元素即为答案。

```rust
impl Solution {
    pub fn majority_element(nums: Vec<i32>) -> i32 {
        let mut cnt = 0;
        let mut res = 0;
        for v in nums {
            if cnt == 0 {
                cnt = 1;
                res = v;
            } else if res == v {
                cnt += 1;
            } else {
                cnt -= 1;
            }
        }
        res
    }
}
```
